import React, { Component } from "react";
import axios from "axios";
import {
  Modal,
  ModalHeader,
  ModalFooter,
  ModalBody,
  Table,
  Button
} from "reactstrap";
class App extends Component {
  state = {
    visions: [],
    newVisionModal: false
  };
  componentWillMount() {
    axios.get("http://localhost:8000/api/vision/").then(response => {
      this.setState({
        visions: response.data //response by server
      });
    });
  }
  //update state variable
  toggleNewVisionModal() {
    this.setState({
      newVisionModal: !this.state.newVisionModal
    });
    //this.state.newBookModal = true;
  }
  render() {
    let visions = this.state.visions.map(vision => {
      return (
        <tr key={vision.id}>
          <td>{vision.id}</td>
          <td>{vision.mission}</td>
          <td>{vision.goal}</td>
          <td>{vision.outcome}</td>
          <td>
            <Button color="success" size="sm" className="mr-2">
              Edit
            </Button>
            <Button color="danger" size="sm">
              Delete
            </Button>
          </td>
        </tr>
      );
    });
    return (
      <div className="App container">
        <Button color="danger" onClick={this.toggleNewVisionModal.bind(this)}>
          Add Vision
        </Button>
        <Modal
          isOpen={this.state.newVisionModal}
          toggle={this.toggleNewVisionModal.bind(this)}
        >
          {" "}
          <ModalHeader toggle={this.toggleNewVisionModal.bind(this)}>
            Add Vision
          </ModalHeader>
          <ModalBody></ModalBody>
          <ModalFooter>
            <Button
              color="primary"
              onClick={this.toggleNewVisionModal.bind(this)}
            >
              Do Something
            </Button>{" "}
            <Button
              color="secondary"
              onClick={this.toggleNewVisionModal.bind(this)}
            >
              Cancel
            </Button>
          </ModalFooter>
        </Modal>

        <Table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Mission</th>
              <th>Goal</th>
              <th>Outcome</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>{visions}</tbody>
        </Table>
      </div>
    );
  }
}
export default App;
